import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const Screen = props => {

  return (
    <div className="screen-wrap">
      (props.section )
      <h1 className={props.screen}>{props.text}</h1>
    </div>
  )

}



class App extends Component {

  state = {
    section: "home",
    text: "jello"
  }

  render() {
    return (
      <div className="app">
          <Screen screen={this.state.section} text={this.state.text}/>
      </div>
    );
  }
}

export default App;
